    "2016-07-27T22:45:39.693089",nt"name": "narrative-report-for-september-october-november-and-december-1943-des-lacs-national-wildli",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1943. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, fish, and
    disease- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and wildfires. Resource management is outlined;
    topics include grazing, haying, and fur harvesting. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    and hunting. N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
